import { Gif } from "../utils/types";

const mockGif: Gif = {
  id: "N2mqhDZzRUbqB2Z2SE",
  title: "Happy Dolphin GIF",
  images: {
    original: {
      width: 480,
      url: "data:image/gif;base64,",
    },
    fixed_width: {
      width: 200,
      url: "data:image/gif;base64,",
    },
  },
  alt_text: "A happy dolphin",
};

/**
 * Generates an array of mock Gif objects.
 * @param {number} limit - The number of mock Gif objects to generate.
 * @returns {Gif[]} An array of mock Gif objects with unique IDs.
 */
export const getMockGifs = (limit: number = 1): Gif[] => {
  return new Array(limit)
    .fill(mockGif)
    .map((gif, index) => ({ ...gif, id: gif.id + index }));
};
